import React from 'react';
import './Frustration.css'

const Frustration = () => {
    return(
        <div className="frustration_wrapper">
          <div style={{width:'auto', textAlign: 'center', backgroundColor: '#white', height: '500px'}}>
            <h1 className="frustrated_bold">Frustrated?</h1>
            <p className="frustration_p"> 
            You tried Tinder, Bumble, Coffee Meets Bagel, Plenty of Fish, Zoosk, Elite 
            Singles, OkCupid, Hinge, Happn, Match, EHarmony. 
            </p>
            <h1 className="frustration_bottom_h1">
              Did those tools work? Nope.
              </h1>

          </div>
          <div style={{width:'100%', textAlign: 'center', backgroundColor: '#1c2d35', marginTop: '-100px'}}>
            {/* <h1 style={{color: 'white', fontSize: '55px', fontWeight: '700', paddingTop: '30px'}}>Before switching to Kupenda...</h1> */}
            {/* <img src={appIcons} style={{width:'100%'}}/> */}
          </div>
        </div>
    )
}

export default Frustration
